package main

import (
	"database/sql"
	"fmt"
	"log"
	"net/http"
	"time"

	_ "github.com/mattn/go-sqlite3"
)

type Request struct {
	ID       int
	Method   string
	URI      string
	RemoteIP string
	Time     time.Time
}

func main() {
	// Connect to the SQLite database
	db, err := sql.Open("sqlite3", "requests.db")
	if err != nil {
		log.Fatal(err)
	}
	defer db.Close()

	// Create the table if it doesn't exist
	_, err = db.Exec("CREATE TABLE IF NOT EXISTS requests (ID INTEGER PRIMARY KEY, Method TEXT, URI TEXT, RemoteIP TEXT, Time TEXT)")
	if err != nil {
		log.Fatal(err)
	}

	http.HandleFunc("/", handler)

	log.Fatal(http.ListenAndServe(":8080", nil))

}

func handler(w http.ResponseWriter, r *http.Request) {
	now := time.Now()

	// Create the request struct with the current request data
	req := Request{
		Method:   r.Method,
		URI:      r.URL.Path,
		RemoteIP: r.RemoteAddr,
		Time:     now,
	}

	// Insert the request into the database
	stmt, err := db.Prepare("INSERT INTO requests (Method, URI, RemoteIP, Time) VALUES (?, ?, ?, ?)")
	if err != nil {
		log.Println(err)
		return
	}
