["Here is a program that uses libiptc to filter TCP data on port 443 and send it to queue number 10000:

```c
#include <libiptc/libiptc.h>
#include <stdlib.h>

int main() {
  // Create a new iptables chain 
  struct iptc_handle *handle = iptc_init("filter");

  if(!handle) {
    perror("Error initializing libiptc");
    exit(1);
  }

  // Add a rule to match TCP port 443
  struct ipt_entry *entry = iptc_entry_alloc("filter");

  if(!entry) {
    perror("Error allocating ipt_entry"); 
    iptc_free(handle);
    exit(1);
  }

  struct ipt_entry_match *match = iptc_match_alloc("tcp");
  if(!match) {
    perror("Error allocating match");
    iptc_free(handle);
    exit(1);  
  }

  struct ipt_entry_target *target = iptc_target_alloc("NFQUEUE", handle);
  if(!target) {
    perror("Error allocating target");
    iptc_free(handle);
    exit(1);
  }

  iptc_match_set_u16(match, "sport", 0, 443);

  target->data.queue_num = 10000;

  iptc_entry_appendmatch(entry, match);
  iptc_entry_set_target(entry, target);

  // Insert rule
  if(!iptc_append_entry(handle, "filter", entry)) {
    perror("Error adding entry");
    iptc_free(handle);
    exit(1);
  }

  // Free memory  
  iptc_free(handle);

  return 0;
}
```

The key points are:

- Use libiptc to initialize a new iptables handle
- Allocate a rule, match, and target 
- Set the TCP source port to 443 in the match
- Set the queue number to 10000 in the NFQUEUE target
- Append the rule to the filter table
- Free memory when done

This will add an iptables rule that will match all TCP traffic on port 443 and send it to queue #10000 for userspace processing."]

