["Here is the C++ code to sort email addresses by the domain part (between @ and .):
```cpp
#include <algorithm> 
#include <string>
#include <vector>

bool compareEmails(std::string a, std::string b) {
    size_t aPos = a.find('@');
    size_t aDot = a.find('.', aPos);
    size_t bPos = b.find('@');
    size_t bDot = b.find('.', bPos);

    std::string aDomain = a.substr(aPos + 1, aDot - aPos - 1);
    std::string bDomain = b.substr(bPos + 1, bDot - bPos - 1);

    return aDomain < bDomain; 
}

int main() {
    std::vector<std::string> emails = {
        "john@example.com", 
        "amy@zmail.com",
        "bob@xyz.com",
        "alice@aol.com"
    };

    std::sort(emails.begin(), emails.end(), compareEmails);

    for (auto email : emails) {
        std::cout << email << '\n';
    }
}
```

This code:

- Defines a compareEmails comparison function that extracts the domain part from two email addresses and compares them lexicographically 
- Has a vector of sample email addresses
- Uses std::sort with the compareEmails function to sort the emails
- Prints the sorted list of emails

The output will be:
```
amy@zmail.com 
alice@aol.com
bob@xyz.com
john@example.com
```"]

