["* **Mutexes** are used to protect shared data from being accessed by multiple threads at the same time. A mutex is a variable that can be either locked or unlocked. When a thread wants to access shared data, it must first lock the mutex. This prevents other threads from accessing the data until the first thread unlocks the mutex.

```
mutex = new Mutex()

// Lock the mutex before accessing shared data
mutex.lock()

// Access shared data

// Unlock the mutex when you're done
mutex.unlock()
```

* **Read-write locks** are used to allow multiple threads to read shared data at the same time, but only one thread to write to the data at a time. A read-write lock has two states: read and write. When a thread wants to read shared data, it must acquire a read lock. When a thread wants to write to shared data, it must acquire a write lock.

```
lock = new ReadWriteLock()

// Acquire a read lock before reading shared data
lock.readLock().lock()

// Read shared data

// Release the read lock when you're done
lock.readLock().unlock()

// Acquire a write lock before writing to shared data
lock.writeLock().lock()

// Write to shared data

// Release the write lock when you're done
lock.writeLock().unlock()
```

* **Barriers** are used to synchronize threads. A barrier is a point in a program where all threads must wait until all other threads have reached the same point. Barriers can be used to ensure that all threads complete a task before moving on to the next task.

```
barrier = new CyclicBarrier(numThreads)

// Wait for all threads to reach the barrier
barrier.await()

// All threads have reached the barrier
```"]

