["Here is one way to sort a vector of email addresses based on the substring that comes after the @ symbol and before the next period sign:
```
#include <iostream>
#include <algorithm>
#include <string>
#include <vector>

int main() {
    std::vector<std::string> email_addresses = {
        "john.doe@example.com",
        "jane.doe@example.com",
        "jim.smith@example.org"
    };

    std::sort(email_addresses.begin(), email_addresses.end(),
              [](const std::string& a, const std::string& b) {
                  size_t a_start = a.find_first_of("@");
                  size_t b_start = b.find_first_of("@");
                  std::string a_substring = a.substr(a_start + 1);
                  std::string b_substring = b.substr(b_start + 1);
                  return a_substring < b_substring;
              });

    for (const std::string& email_address : email_addresses) {
        std::cout << email_address << std::endl;
    }

    return 0;
}
